import React from 'react';
import Transition from './intro components/Transition';
import Grid from '@material-ui/core/Grid';

const Introduction = props => {
	return (
		<>
			<div className='rtl'>
				<h1 className='heading'>!تایپ آنلاین به‌صرفه</h1>
				<Grid container justify='space-around'>
					<Grid item xs={6}>
						<Transition />
					</Grid>
				</Grid>
			</div>
		</>
	);
};

export default Introduction;
